import React from 'react';
import Header from '../Header/Header.js';
import Footer from '../Footer/Footer.js';
import Main from '../Main/Main.js';
import PopupWithForm from '../PopupWithForm/PopupWithForm.js';

function App() {

  return (
    <div className="App">
      <Header />
      <Main />
      <Footer />
      <PopupWithForm name='edit' title='Редактировать профиль'/>
      <PopupWithForm name='add' title='cfkadfs'/>
      <PopupWithForm name='delete-card' title='Вы уверены?'/>
      <PopupWithForm name='change-avatar' title='Обновить аватар'/>
      <template className="element-template" />
      <div className="popup popup_type_open">
        <form name="photoViewForm" className="popup__box">
          <img className="popup__image" src="#" alt="#" />
          <button type="button" className="popup__close popup__close-img" />
          <h3 className="popup__img-title" />
        </form>
      </div>

    </div>
  );
}

export default App;
